    "2015-01-22T15:57:42.648700",nt"name": "home-rent-limits",nt"isopen":
    false,nt"url": null,nt"notes": "In accordance with 24 CFR Part 92.252,
    HUD provides maximum HOME rent limits. The maximum HOME rents are the lesser of:
     The fair market rent for existing housing for comparable units in the area as
    established by HUD under 24 CFR 888.111 or A rent that does not exceed 30 percent
    of the adjusted income of a family whose annual income equals 65 percent of the
    median income for the area, as determined by HUD, with adjustments for number of
    bedrooms in the unit. The HOME rent limits provided by HUD will include average
    occupancy per unit and adjusted income assumptions.",nt"license_title": "License
